                    <h1>Почему Уран вращается на боку?</h1>
                    <p>Большинство планет Солнечной системы имеют свои полюсы, более или менее ориентированные в одном направлении. И большинство из них вращаются против часовой стрелки, если смотреть сверху. Ориентация Урана в пространстве отличается от остальных планет — его ось вращения лежит как бы на боку относительно плоскости обращения этой планеты вокруг Солнца, и вращается он по часовой стрелке.</p1>


                    <p>Обычно для объяснения этой странности приводится гипотеза, согласно которой когда-то давно произошло столкновение Урана с крупным космическим телом, оно и опрокинуло планету. Хотя этот сценарий не является невозможным, в этой модели есть несколько существенных противоречий: например, она не может объяснить, по");
            WriteLiteral(@"чему ни одна из лун Урана не обладает такой же наклонной орбитой. Кроме того, эти луны ледяные, а мощный удар, достаточный для того, чтобы перевернуть ось вращения планеты, должен был генерировать большое количество тепла, которое испарило бы лед на этих спутниках, сделав их каменистыми.</p>


                    <p>Астрономы из Университета Мэриленда Зив Рогошински (Zeeve Rogoszinski) и Дуглас Гамильтон (Douglas Hamilton) придумали новый сценарий, снимающий эти противоречия. Согласно их гипотезе, Уран мог быть наклонен вбок гигантской кольцевой системой.</p>


                    <p>Сейчас кольца Урана весьма слабые, состоящие из мельчайших частиц пыли, но ученые считают, что 4,5 миллиарда лет назад, в момент образования Солнечной системы, они могли быть значительно массивнее. О том, что кольца могут быть временными и недолговечными, говорят данные, полученные автоматической межпланетной станцией ""Кассини"", изучавшей кольца Сатурна.</p>


                    <p>Модель Рогошинского и Гамильтона предп");
            WriteLiteral(@"олагает, что большая кольцевая система раскачивала Уран, заставляя его вращаться вокруг своей оси с заметной спиновой прецессией — по типу того, как начинает раскачиваться вращающийся волчок. Затем, если прецессия оси вращения планеты попала в резонанс с орбитальной прецессией планеты (так называется медленное вращательное смещение эллипса орбиты по отношению к Солнцу), планету могло развернуть.</p>


                    <p>Резонанс между спиновой и орбитальной прецессией известен как спин-орбитальный резонанс, и он может генерировать большой осевой наклон. Считается, что именно резонанс такого типа привел к осевому наклону Сатурна по сравнению с направлением оси его ближайшего собрата, Юпитера.</p>


                    <p>Ранее для объяснения осевого наклона Урана уже выдвигалась гипотеза спин-орбитального резонанса, но в качестве тела, вызвавшего резонанс, предлагалась гипотетическая Девятая планета.</p>


                    <p>Авторы считают, что кольцевая система, являющаяся частью процесса фор");
            WriteLiteral(@"мирования планет-гигантов, для этого подходит лучше. Они смоделировали Уран и Нептун с большими дисками, чтобы увидеть, как они взаимодействуют с планетами, и обнаружили, что кольцевая система в течение миллиона лет может отклонить ось вращения планеты на 70 градусов. Эта модель легко объясняет осевой наклон Нептуна, составляющий 30 градусов. Но для Урана, очевидно, было еще какое-то дополнительное воздействие, и теория столкновения с другим космическим телом все еще имеет право на жизнь. Но в таком контексте это могут быть небольшие астероиды, а не крупные космические тела, что делает сценарий более вероятным.</p>

                    <p>""Хотя мы можем генерировать наклоны больше 70 градусов лишь в редких случаях и не можем управлять наклонами выше 90 градусов, последующее столкновение с объектом, составляющим примерно половину массы Земли, может наклонить Уран от 70 до 98 градусов, — пишут исследователи в своей статье. — Минимизация массы и количества гигантских ударников от двух или более до одного увели");
